  },
  {
    icon: 'üì¢',
    title: 'Í¥ëÍ≥†ÎÇò SNSÎäî ÎÇ® ÏñòÍ∏∞ Í∞ôÏïÑÏöî',
    desc: 'ÎÇ¥ ÏàôÏÜåÎßåÏùò Îß§Î†•ÏùÑ ÏïåÎ¶¨Í≥† Ïã∂ÏùÄÎç∞, Ïñ¥ÎîîÏÑúÎ∂ÄÌÑ∞ ÏãúÏûëÌï¥Ïïº Ìï†ÏßÄ ÎßâÎßâÌïòÏßÑ ÏïäÏúºÏÑ∏Ïöî?'
  },
  {
    icon: 'üßæ',
    title: 'ÏòàÏïΩ, Ï≤≠ÏÜå, Ï†ïÏÇ∞ÍπåÏßÄ Îã§ ÏßÅÏ†ë?',
    desc: 'Î™®Îì† ÌîÑÎ°úÏÑ∏Ïä§Î•º ÏàòÍ∏∞Î°ú ÌïòÎã§Î≥¥Îãà Ïã§ÏàòÎèÑ Ïû¶Í≥†, Í¥ÄÎ¶¨Í∞Ä Î≤ÑÍ≤ÅÏßÄ ÏïäÏúºÏÑ∏Ïöî?'
  },
];

const Problems: React.FC = () => {
  return (
    <section id="problems" className="w-full bg-white py-24">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="mb-16">
          <motion.h2
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
            className="text-center text-4xl md:text-5xl font-semibold text-gray-900 mb-3 tracking-tight"
