        </div>
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-10">
          {problems.map((problem, idx) => (
            <motion.div
              key={problem.title}
              initial={{ opacity: 0, y: 20 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: 0.1 * idx }}
              viewport={{ once: true }}
              className="bg-white rounded-3xl p-8 shadow-lg flex flex-col items-center text-center border border-transparent hover:border-primary-400 hover:shadow-xl transition-all duration-200 ease-in-out hover:-translate-y-1"
            >
              <div className="mb-5 flex items-center justify-center w-16 h-16 rounded-full bg-primary-50">
                {problem.icon === 'clock' && <FiClock className="text-primary-500" size={36} />}
                {problem.icon === 'dollar' && <FiDollarSign className="text-primary-500" size={36} />}
                {problem.icon === 'message' && <FiMessageCircle className="text-primary-500" size={36} />}
                {problem.icon === 'trending' && <FiTrendingDown className="text-primary-500" size={36} />}
                {problem.icon === 'volume' && <FiVolume2 className="text-primary-500" size={36} />}
                {problem.icon === 'file' && <FiFileText className="text-primary-500" size={36} />}
              </div>
              <div className="font-semibold text-xl text-gray-900 mb-2 tracking-tight">
                {problem.title}
              </div>
              <div className="text-secondary-600 text-base leading-relaxed font-normal">
                {problem.desc}
              </div>
            </motion.div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Problems;
